import React from 'react'
import {Redirect,Route} from 'react-router-dom'

const Protect=({component:Cmp,...rest})=>{

    <Route
    
    {...rest}
    render={(props)=>{
        localStorage.getItem('token') ?(

            <Cmp {...props} />
        ):

            <Redirect
            to="/"
            />
    }}
    
    />


};
export default Protect
